import React, { Component } from "react";

class Home extends Component {
  componentDidMount() {
    console.log("Home Loaded");
  }
  render() {
    return (
      <div className="home">
        <h1>Hello, I'm</h1>
        <h1>AMAN KUMAR</h1>
        <h1>A Front End Web Developer</h1>
        <button onClick={() => this.props.navigate("about", 1)}>
          Let's Begin
        </button>
      </div>
    );
  }
}

export default Home;
